import React, { Component } from "react";
import Navbar from "../components/layouts/navbar";

class Story extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <div className="ui text container">
          <center>
            <h1 className="warranty">Story</h1>
            <br />
          </center>
        </div>
      </React.Fragment>
    );
  }
}

export default Story;
